    render() {
        return (
          <div>
              <Header />
              <section>
                <img src='https://scontent.fplu4-1.fna.fbcdn.net/v/t1.6435-9/50234276_2039919682754418_5925048599061725184_n.jpg?_nc_cat=106&ccb=1-5&_nc_sid=09cbfe&_nc_eui2=AeGYm19j7Nf9wwoS_JnDPN3fJcNIaWBZFoglw0hpYFkWiAi-cRFVlQlIN04IW8Jz05B01pg_vtcFXmJrtHfzhvLW&_nc_ohc=MVzVHRdCeaYAX-MpOY1&tn=yo4mCv-6Cay_Gace&_nc_ht=scontent.fplu4-1.fna&oh=e02b67b090f7c1a71b91be8f851289b3&oe=61CE31CF' className='logoGQF' alt='logoGQF'/>
                </section>
                <section>Produção Artesanal Familiar</section>

              </div>
        )
    }
}

export default Ecomerce;
